const Heading =styled(Box)`
    background:#1d1e22;

    `

const Editor=() =>{
    return (
        <Box>
            <Box>
                <Heading>
                    <Box component="span" 
                    style={{
                        background: 'red',
                        height:20,
                        width:20,
                        display:'flex',
                        placeContent :'center',
                        borderRadius:5,
                        marginRight:5,
                        paddingBottom:2

                }}
                >/</Box>
                    HTML
                </Heading>
            </Box>
            <Box>

            </Box>
        </Box>
    )
}
export default Editor;
